import React, { useCallback, useMemo, useState } from "react";
import {
  FlexibleWidthXYPlot,
  HorizontalGridLines,
  LineSeries,
  Treemap,
  XAxis,
  YAxis,
} from "react-vis";

import "react-vis/dist/style.css";

import "./App.css";
import { Tooltip } from "./components";

const features = [
  "LotArea",
  "YearBuilt",
  "GrLivArea",
  "KitchenAbvGr",
  "FirstFlrSF",
  "PoolArea",
  "TotalBsmtSF",
  "BsmtFinSFOne",
  "BsmtUnfSF",
  "GarageYrBlt",
  "EnclosedPorch",
  "WoodDeckSF",
  "MSSubClass",
  "MiscVal",
  "OpenPorchSF",
  "ThreeSsnPorch",
  "YearRemodAdd",
  "YrSold",
  "GarageArea",
  "LowQualFinSF",
  "BsmtFinSFTwo",
  "OverallCond",
  "MoSold",
  "SecondFlrSF",
  "TotRmsAbvGrd",
  "ScreenPorch",
  "Fireplaces",
  "OverallQual",
  "HalfBath",
  "MasVnrArea",
  "GarageCars",
  "LotFrontage",
  "BsmtFullBath",
  "FullBath",
  "BedroomAbvGr",
  "BsmtHalfBath",
];

const tableColumns = ["ID", "Actual", "Predicted", "Difference", ...features];

const tableRows = new Array(tableColumns.length).fill(1).map(() => {
  const row = {};
  tableColumns.forEach(
    (tableColumn) => (row[tableColumn] = Math.random() * 1000 - 500)
  );
  return row;
});

function App() {
  const [selectedRowIndex, setSelectedRowIndex] = useState();

  const [tooltipData, setTooltipData] = useState();

  const treeChartData = useMemo(() => {
    const positiveChildren = [];
    const negativeChildren = [];

    if (selectedRowIndex !== undefined) {
      const selectedRow = tableRows[selectedRowIndex];
      features.forEach((feature) => {
        let children, color;
        const value = selectedRow[feature];
        if (value < 0) {
          children = negativeChildren;
          color = "#006f3c";
        } else {
          children = positiveChildren;
          color = "#bf212f";
        }
        children.push({ title: feature, size: Math.abs(value), color, value });
      });
    }

    return {
      children: [
        {
          title: "Negative",
          children: positiveChildren,
          color: "none",
        },
        {
          title: "Positive",
          children: negativeChildren,
          color: "none",
        },
      ],
    };
  }, [selectedRowIndex]);

  const [treeMapDimensions, setTreeMapDimensions] = useState({
    width: 0,
    height: 0,
  });

  const treeMapContainer = useCallback((treeMapContainerElement) => {
    if (treeMapContainerElement !== null) {
      const {
        clientWidth: width,
        clientHeight: height,
      } = treeMapContainerElement;
      setTreeMapDimensions({ width, height });
    }
  }, []);

  return (
    <main>
      <section id="mosaic">
        {features.map((feature, index) => (
          <div key={`chart-${index}`}>
            {feature}

            <FlexibleWidthXYPlot height={300}>
              <HorizontalGridLines />
              <LineSeries
                color="red"
                data={[
                  { x: 1, y: 10 },
                  { x: 2, y: 5 },
                  { x: 3, y: 15 },
                ]}
              />
              <XAxis title="X" />
              <YAxis />
            </FlexibleWidthXYPlot>
          </div>
        ))}
      </section>
      <section
        id="main"
        ref={treeMapContainer}
        onMouseLeave={() => setTooltipData()}
      >
        {selectedRowIndex === undefined && "Select a row in the table below"}
        <Treemap
          title={"Test"}
          data={treeChartData}
          mode="squarify"
          hideRootNode
          colorType="literal"
          onLeafMouseOver={({ data }) => setTooltipData(data)}
          onLeafClick={(...args) => console.log("klikk", [args])}
          padding={1}
          margin={0}
          {...treeMapDimensions}
        />
        <Tooltip data={tooltipData} />
      </section>
      <section>
        <table>
          <thead>
            <tr>
              {tableColumns.map((column, index) => (
                <th key={`feature-${index}`}>{column}</th>
              ))}
            </tr>
          </thead>
          <tbody>
            {tableRows.map((row, index) => (
              <tr
                key={`row-${index}`}
                className={index === selectedRowIndex ? "selected" : ""}
                onClick={() => setSelectedRowIndex(index)}
              >
                {tableColumns.map((column, index) => (
                  <td key={`feature-${index}`}>{row[column]}</td>
                ))}
              </tr>
            ))}
          </tbody>
        </table>
      </section>
    </main>
  );
}

export default App;
